import { useRef, useState } from 'react';
import { useDispatch, useSelector } from "react-redux"
import React from 'react'
import { fetchAuth, selectName, logout, selectIsAuth, fetchRegistration } from '../../redux/slices/auth';
import Header from './Header/Header';

import iconSet2 from "../../styles/icons/selection2.json";
import IcomoonReact, { iconList } from "icomoon-react";

// import '../../styles/css/style.css'




let Home = () => {

   const name = useSelector(selectName)
   const scrollUpper = useRef(null)
   const scrollLower = useRef(null)
   const fullscreen = useRef(null)

   const [input1, setInput1] = useState('')
   const [input2, setInput2] = useState('')

   const handleScroll = () => {
      console.log("scroll")

      if (window.pageYOffset <= 200) {
         scrollLower.current.style.opacity = "1";
         scrollLower.current.style.cursor = "pointer";

         scrollUpper.current.style.opacity = "0";
         scrollUpper.current.style.cursor = "default";
      } else {
         scrollLower.current.style.opacity = "0";
         scrollLower.current.style.cursor = "default";

         scrollUpper.current.style.opacity = "1";
         scrollUpper.current.style.cursor = "pointer";
      }
   }
   console.log(name)

   const clickLower = () => {
      console.log("click upper")
      console.log(window.innerWidth)
      window.scrollTo({
         top: 1000000,
         left: 0,
         behavior: 'smooth'
      })
   }
   const clickUpper = () => {
      console.log("click lower")
      window.scrollTo({
         top: 0,
         left: 0,
         behavior: 'smooth'
      })
   }

   React.useEffect(() => {
      window.addEventListener("scroll", handleScroll)
      return () => window.removeEventListener("scroll", handleScroll);
   }, [])



   return (
      <div class="wrappper">
         <div class="content">
            <div ref={fullscreen} class="fullscreen">
               <Header />
               <div class="fullscreen__body body">
                  <div className="body__title">Категории</div>
                  <div className="body__types types">
                     <div className="types__row">
                        <div className="types__item types-item">
                           <div className="types-item__title">Спорт</div>
                           <IcomoonReact iconSet={iconSet2} color="#6b6b6b" size={40} icon="soccer-ball" />
                        </div>
                        <div className="types__item types-item">
                           <div className="types-item__title">Электротехника</div>
                           <IcomoonReact iconSet={iconSet2} color="#6b6b6b" size={40} icon="display" />
                        </div>
                        <div className="types__item types-item">
                           <div className="types-item__title">Недвижимость</div>
                           <IcomoonReact iconSet={iconSet2} color="#6b6b6b" size={40} icon="office" />
                        </div>
                     </div>
                     <div className="types__row">
                        <div className="types__item types-item">
                           <div className="types-item__title">Авто</div>
                           <IcomoonReact iconSet={iconSet2} color="#6b6b6b" size={40} icon="truck" />
                        </div>
                        <div className="types__item types-item">
                           <div className="types-item__title">Одежда</div>
                           <IcomoonReact iconSet={iconSet2} color="#6b6b6b" size={40} icon="t-shirt" />
                        </div>
                        <div className="types__item types-item">
                           <div className="types-item__title">Животные</div>
                           <IcomoonReact iconSet={iconSet2} color="#6b6b6b" size={40} icon="pet" />
                        </div>
                     </div>

                  </div>
                  <div className="body__horizontal">
                     </div>
                     <div className="body__main">
                        <div className="body__settings settings">
                           <div className="body__title">Цена</div>
                           <div className="settings__block">
                              <div className="settings__text">От</div>
                              <input
                                 className='settings__input'
                                 type="text"
                                 name='input1'
                                 value={input1}
                                 onChange={(event) => setInput1(event.target.value)}
                              />
                           </div>
                           <div className="settings__block">
                              <div className="settings__text">До</div>
                              <input
                                 className='settings__input'
                                 type="text"
                                 name='input1'
                                 value={input2}
                                 onChange={(event) => setInput2(event.target.value)}
                              />
                           </div>
                        </div>
                     <div className="body__carts"></div>
                     </div>
               </div>
               {/* <div class="fullscreen__body body">
                  <div class="body__slogan">
                     <div class="body__title">Вы потеряли —<br />Другие помогут</div>
                     <div class="body__subtitle">Любая потерянная вещь это напасть,<br />но здесь ты сможешь её найти</div>
                  </div>
                  <div onClick={() => clickLower(fullscreen.offsetHeight)} ref={scrollLower} class="body__arrow">
                     <svg width="24" height="24" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink">
